// Authenticated.js
import React, { useState } from 'react';
import Navbar from './Navbar';
import Login from './Login';

function Authenticated({ loggedIn }) {
  const [authenticated, setAuthenticated] = useState(loggedIn);

  // Function to handle login
  const handleLogin = () => {
    setAuthenticated(true); // Update authenticated state upon successful login
  };

  return (
    <div>
      {authenticated ? (
        <div>
          <p>Welcome, you are logged in!</p>
          <Navbar authenticated={authenticated} />
        </div>
      ) : (
        <Login onLogin={handleLogin} /> // Pass handleLogin as onLogin prop
      )}
    </div>
  );
}

export default Authenticated;
